import React, { Component } from 'react';
import Thread from './thread';
// import GoogleLoginWithFirebase from './googleLoginWithFirebase';
// import { handleGoogleSignIn } from '../utils/google-auth';
// import { handleGoogleSignIn } from '../utils/google-auth';


const Contacts = (props) => {

    const {login, phot} = props;

        return (

            <div>
                <div className='row'>
                    <div className='col-12'>
                        <img alt='logo' src='https://upload.wikimedia.org/wikipedia/commons/thumb/6/6b/WhatsApp.svg/2044px-WhatsApp.svg.png' style={{ width: 50, height: 50 }}></img>

                        <button className='btn btn-sm btn-outline-secondary float-end mt-2'onClick={login}>Login</button>

                    </div>

                </div>
                <div className='row mt-3'>
                    <div className='col-12'>
                        <input type='text' className='form-control' placeholder='Search here'></input>

                    </div>

                </div>


                <div className='row mt-3' style={{ borderTop: "1px #e2e2e2 solid" }}>

                </div>
                <div className='col-12'>
                    <Thread />
                </div>
                <div className='col-12'>
                    <Thread />
                </div>
                <div className='col-12'>
                    <Thread />
                </div>
                <div className='col-12'>
                    <Thread />
                </div>



            </div>




        )

}

export default Contacts;
